                                    medical: 'एम्स समेत देश के तमाम मेडिकल कॉलेजों की एमबीबीएस सीटों पर नेशनल एलिजिबिलिटी कम एंट्रेंस टेस्ट अंडरग्रेजुएट (नीट यूजी) के जरिए दाखिला होता है\u0964 बहुत से मेडिकल कॉलेजों में एमबीबीएस के अलावा 12वीं पास के लिए बीएससी नर्सिंग जैसे कोर्स में कराए जाते हैं\u0964 भारत सरकार की एनआईआरएफ (नेशनल इंस्टीट्यूशनल रैंकिंग फ्रेमवर्क) रैंकिंग 2022 के मुताबिक एम्स दिल्ली देश का बेस्ट मेडिकल कॉलेज है\u0964 दूसरे नंबर पर पोस्टग्रेजुएट इंस्टीट्यूट ऑफ मेडिकल एजुकेशन एंड रिसर्च चंडीगढ़, तीसरे पर क्रिश्चियन मेडिकल कॉलेज वेल्लौर, चौथे पर नेशनल इंस्टीट्यूट ऑफ मेंटल हेल्थ एंड न्यूरोसाइंसेज बैंगलोर, 5वें पर बीएचयू, छठे पर जिपमर पुड्डुचेरी, सातवें पर संजय गांधी पीजी इंस्टीट्यूट लखनऊ, आठवें पर अमृता विश्व विद्यापीठम कोयम्बटूर, 9वें पर चित्रा तिरुनल इंस्टीट्यूट ऑफ मेडिकल साइंस तिरुवनंतपुरम और 10वें स्थान पर कस्तूरबा मेडिकल कॉलेज मणिपाल है\u0964',
                                    bba: '12वीं पास करने के बाद मैनेजमेंट एवं बिजनेस के क्षेत्र में करियर बनाने के लिए तीन वर्षीय बैचलर ऑफ बिजनेस एडमिनिस्ट्रेशन (बीबीए) कोर्स अच्छा विकल्प है\u0964 देश में ऐसे सैंकड़ों संस्थान हैं जहां बीबीए कोर्स कराया जाता है\u0964 प्रवेश परीक्षा के जरिए इस कोर्स में दाखिला मिलता है\u0964 सीयूईटी और आईपीयू सीईटी इसके लिए दे सकते हैं\u0964 टॉप कॉलेज की बात करें तो इस लिस्ट में यूपीईएस देहरादून, आचार्या इंस्टीट्यूट ऑफ मैनेजमेंट, नई दिल्ली इंस्टीट्यूट ऑफ मैनेजमेंट, क्राइस्ट यूनिवर्सिटी, जामिया मिल्लिया इस्लामिया दिल्ली, चंडीगढ़ यूनिवर्सिटी, इंद्रप्रस्थ यूनिवर्सिटी, भोपाल स्कूल ऑफ सोशल साइंस, शहीद सुखदेव कॉलेज ऑफ बिजनेस स्टडीज डीयू, मद्रास क्रिश्चिनय कॉलेज, गुरु नानक इंस्टीट्यूट ऑफ टेक्नोलॉजी, प्रेजिडेंसी यूनिवर्सिटी, GITAM हैदराबाद बिजनेस स्कूल प्रमुख हैं\u0964',
                                    bca: '12वीं पास करने के बाद कंप्यूटर या आईटी की फील्ड में करियर बनाने के लिए तीन साल का बीसीए कोर्स किया जा सकता है\u0964 बीसीए की फुल फॉर्म बैचलर इन कंप्यूटर एप्लीकेशंस है\u0964 यह तीन वर्षीय कंप्यूटर एप्लीकेशन का अंडर ग्रेजुएट कोर्स है\u0964 बीसीए में डाटाबेस, डेटा स्ट्रक्चर, नेटवर्किंग, प्रोग्रामिंग लैंग्वेज जैसे सी, सी प्लस प्लस, जावा आदि की जानकारी दी जाती है\u0964 देश में ऐसे सैंकड़ों संस्थान हैं जहां बीसीए कोर्स कराया जाता है\u0964 प्रवेश परीक्षा के जरिए इस कोर्स में दाखिला मिलता है\u0964 बीसीए कराने वाले टॉप इंस्टीट्यूट की लिस्ट में इंद्रप्रस्थ यूनिवर्सिटी, क्राइस्ट यूनिवर्सिटी, यूनिवर्सिटी ऑफ हैदराबाद,वीआईटी, मद्रास यूनिवर्सिटी, जामिया इस्लामिया, सावित्रिबाई फुले पुणे यूनिवर्सिटी, सिम्बायोसिस इंटरनेशनल यूनिवर्सिटी,  पंजाब यूनिवर्सिटी, कलिंग इंस्टीट्यूट ऑफ इंडस्ट्रियल टेक्नोलॉजी प्रमुख हैं\u0964 बीसीए के बाद मास्टर्स प्रोग्राम को चुन कर स्पेसिफिक क्षेत्र में स्पेशलाइजेशन हासिल कर सकते हैं\u0964',
